(116, 'Cardio Aspirin 100mg ', 'Analgesik', 'Mengandung zat aktif Asetosal (Aspirin) yaitu obat golongan anti-fibrinolitik yang bekerja dengan mencegah pembentukan agregat tromboksan pada trombosit dengan menginaktifasi enzim COX.', '1 Dos isi 3 Blister x 10 Tablet', 'Sehari 3-4 kali, usia 1-3 th 1-2 tablet, 3-6 th: 2-3 tablet, 6-12 th :3-5 tablet, diatas 12 th : 6-8 tablet untuk antiplatelet : 80-160mg/hari\r\n', 'nyeri lambung, rasa panas, terbakar, mual, pendarahan GI. Hipersensitivitas, trombositopenia.', '2026-04-18', '22000', 42, );
INSERT INTO `detail_obat` (`kd_obat`, `nama_obat`, `kategori_obat`, `deskripsi`, `kemasan`, `dosis`, `efek_samping`, `tgl_expired`, `harga`, `stok`, `gambar`) VALUES
(117, 'Ibuprofen Promed 400mg Tablet', 'Analgesik', 'Termasuk obat golongan nonsteroidal anti-inflammatory drug (NSAID). Mengatasi nyeri dengan intensitas rendah sampai sedang seperti sakit kepala, sakit gigi, radang sendi, dan nyeri otot.', '1 Dos isi 10 Strip x 10 Tablet', 'Dewasa 200 mg 3-4x sehari. Anak 1-12 tahun untuk mengurangi demam pada anak dengan suhu 39 derajat Celcius 10mg/kgBB diberikan 3-4x / hari.', 'Mual, muntah, diare, konstipasi, nyeri lambung, ruam kulit, bronkospasme, trombositopenia, limfopenia, penurunan ketajaman penglihatan, gangguan daya penglihatan.', '2024-01-04', '25000', 51, ''),
(125, 'Dixol Alkohol 70% 500ml Refill', 'Antiseptik', 'Dapat membunuh dan menghambat pertumbuhan bakteri maupun mikroorganisme lain', '1 Botol', 'Sesuai kebutuhan', '', '2024-07-09', '45000', 26, ''),
(126, 'Rivanol One Med', 'Antiseptik', 'Rivanol mengandung zat aktif Etakridin laktat yang sering digunakan dalam proses perawatan dan penyembuhan luka sayat karena memiliki sifat bakteriostatik (menghambat pertumbuhan kuman) dan tidak bersifat iritatif pada kulit', '1 Botol', 'Sesuai kebutuhan', '', '2026-04-18', '11000', 46, ''),
(127, 'Betadine Sabun Cair 100ml ', 'Antiseptik', 'Digunakan untuk mengatasi masalah pada kulit seperti jerawat, gatal-gatal dan untuk menjaga kesehatan kulit\r\n', '1 Botol', 'Sesuai kebutuhan', 'Reaksi hipersensitif terhadap iodium', '2025-06-04', '45000', 16, ''),
(135, 'Azithromycin Hexpharm 500mg', 'Antibiotik', 'Merupakan antibiotik golongan makrolida. Dapat mengatasi infeksi saluran pernafasan bagian atas & bawah, infeksi kulit ringan dan sedang, uretritis radang uretra/aliran kandung kemih non komplikasi & servisitis radang leher rahim non gonoreal yang disebabkan oleh Chlamydia trachomatis', '1 Dos isi 5 Strip x 6 Tablet', 'Dewasa: infeksi saluran pernapasan, Infeksi kulit dan jaringan lunak Sebagai penangguhan / pelepasan segera: 500 mg / hari selama 3 hari, atau 500 mg sebagai dosis tunggal pada hari 1 kemudian 250 mg / hari pada hari 2-5. Infeksi genital tanpa komplikasi karena Chlamydia trachomatis, Chancroid 1 g sebagai dosis tunggal', 'Mual, muntah, kembung, sakit perut, diare, dispepsia, melena, ikterus kolestatik, palpitasi, nyeri dada, moniliasis, vaginitis, nefritis; pusing, mengantuk, vertigo, somnolen, kelelahan, ruam, fotosensitivitas, angiodema, peningkatan sementara jumlah neutrofil & enzim hati', '2024-07-09', '14750', 9, ''),
(136, 'Cefadroxil Infion 500mg', 'Antibiotik', 'Merupakan antibiotik yang digunakan untuk mengatasi infeksi pada saluran pernafasan atas, infeksi saluran kemih, infeksi kulit dan jaringan lunak. Cefadroxil bekerja dengan menghalangi sintesis protein pada dinding sel bakteri sehingga tidak dapat tumbuh dan menjangkit jaringan pada tubuh', '1 Dos isi 10 Strip x 10 Tablet', 'Dewasa: 1-2 g setiap hari sebagai dosis tunggal atau dalam 2 dosis terbagi. Anak:   6 tahun <40 kg: 30-50 mg / kg setiap hari sebagai dosis tunggal atau dalam 2 dosis terbagi, hingga 100 mg / kg setiap hari\r\n', 'Mual, muntah, diare, alergi (misalnya: ruam), disfungsi hati (mis. kolestasis, peningkatan serum transaminase)', '2026-08-12', '16000', 25, ''),
(137, 'Doxycycline Yarindo 100mg Kapsul', 'Antibiotik', 'Merupakan antibiotik yang bekerja dengan cara menghambat dan menghentikan pertumbuhan bakteri penyebab infeksi', '1 Dos isi 10 Strip x 10 Tablet', 'Sipilis Dewasa: 300 mg/hari dalam dosis terbagi minimal 10 hari. Infeksi yang rentan Dewasa: 200 mg sebagai dosis tunggal atau dalam 2 dosis terbagi (dengan interval 12 jam) pada hari pertama, kemudian 100 mg sekali sehari. Infeksi berat: 200 mg setiap hari.\r\n', 'Gangguan gastrointestinal: stomatitis, mual, muntah, diare, dispepsia, sakit perut, pankreatitis.', '2024-10-27', '12000', 15, ''),
(145, 'Sanmol Forte 250mg', 'Antipiretik', 'Mengandung 250mg paracetamol. Sanmol Forte dapat digunakan untuk meredakan nyeri seperti sakit kepala, sakit gigi, serta demam yang menyertai flu dan setelah imunisasi.\r\n', '1 Botol', 'Dewasa dan Anak diatas 12 tahun: 2 - 2 1/2 sendok takar (10- 12,5 ml), 3-4 kali sehari. Anak 9 - 12 tahun: 1- 2 sendok takar (5 - 10 ml), 3-4 kali sehari', 'Reaksi hematologi, reaksi kulit, dan reaksi alergi lainnya, kerusakan hati pada penggunaan jangka lama dan overdosis', '2026-12-08', '19000', 22, ''),
(146, 'Metamizole Imfarmind 500mg Kaplet', 'Antipiretik', 'Merupakan golongan obat antiinflamasi nonsteroid yang digunakan untuk mengurangi rasa sakit seperti sakit kepala, sakit gigi, arthralgia dengan intensitas ringan hingga sedang dan menurunkan panas', '1 Dos isi 10 Strip x 10 Tablet', 'Dewasa: Sebagai natrium metamizole: dosis 0,5-1 g dapat diberikan hingga 3-4 kali sehari. Maks: 4 g setiap hari. Waktu pengobatan maks: 3-5 hari., Anak: Sebagai natrium methimazole drops: > 3 bulan Dosis bervariasi berdasarkan berat badan. Dosis yang dianjurkan: 8-16 mg / kg sebagai dosis tunggal, dapat diulangi jika perlu, hingga 3 atau 4 kali sehari. sesuaikan dengan petunjuk masing-masing produk untuk pedoman terperinci', 'Ketidakstabilan sirkulasi darah seperti pada infark miokard, cedera ganda, syok, gangguan koagulasi darah. Asama bronkial, infeksi saluran nafas kronik. gangguan fungsi hati atau ginjal. Pemakaian dalam jangka lama dan terus menerus', '2027-06-08', '42000', 56, ''),
(147, 'Ketoprofen Hexpharm 100mg', 'Antipiretik', 'Merupakan obat yang digunakan untuk mengobati gejala-gejala artritis rematoid, ankilosing spondilitis, gout akut dan osteoartritis serta kontrol nyeri dan inflamasi akibat operasi ortopedik. Obat ini bekerja dengan cara menghambat enzim COX dalam menghasilkan prostaglandin, sehingga rasa sakit dan peradangan akan berkurang', '1 Dos isi 5 Strip x 10 Tablet', 'Dosis awal yang dianjurkan : 75 mg 3 kali sehari atau 50 mg 4 kali sehari. Dosis maksimum : 300 mg sehari', 'Mual, sakit kepala, pusing, kelelahan, diare, konstipasi, dispepsia', '2025-07-17', '22000', 40, '');

